webpackJsonp([85174689309492],{748:function(n,r){n.exports={data:{markdownRemark:{frontmatter:{title:"TEPLO BEZDONNOE",type:"lyrics"},html:"<h1>ТЕПЛО БЕЗДОННОЕ</h1>\n<section>\n<p>стекло оконное<br>\nтепло ладонное<br>\nтепло бездонное<br>\nа я — бездомная</p>\n<p>камнями острыми<br>\nдаль баламуть!<br>\nласковые гнёзда<br>\nласточкина грудь</p>\n<p>Днём и ночью я пою, как дышу,<br>\nЕсли надо, и железо сокрушу.</p>\n<p>тепло оконное<br>\nстекло ладонное<br>\nв стекле — бездонная<br>\nтепло бездомное</p>\n<p>родимых выкликнуть<br>\nочами свеч<br>\nпо‐птичьи выкрикнуть<br>\nочами жечь</p>\n<p>Днём и ночью я пою, как дышу,<br>\nЕсли надо, и железо сокрушу.<br>\nПойте‐пойте, голубые стебельки,<br>\nКак стальные закалённые клинки!</p>\n</section>"}},pathContext:{path:"/en/lyrics/teploBezdonnoe/",langKey:"en"}}}});
